import React from "react";
import "./NavBar.css";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <div id="main-menu">
     <div className="main-menu">
      <label id="hamburger-menu">
        <input type="checkbox" />
        <span className="menu">
          {" "}
          <span className="hamburger"></span>{" "}
        </span>
        <ul>
   
          <li>
            {" "}
            <Link to="/">Home</Link>{" "}
          </li>
          <li>
            {" "}
            <Link to="/">Order</Link>{" "}
          </li>
          <li>
            {" "}
            <a TO="#">Leaderboards</a>{" "}
          </li><li>
            {" "}
            <a href="#">Marketplace</a>{" "}
          </li><li>
            {" "}
            <a href="/faqs">FAQs</a>{" "}
          </li>
        </ul>
      </label></div> 

      <div className="div">
      <Link to="/home">
        <img className="logo" src="./images/Twenteefore - Logo 2.png" />
      </Link>
      <nav className="navbar">
        {" "}
        <Link className="homeLink" to="/">
          Home
        </Link>
        <Link className="orderLink" to="/">
          Order
        </Link>
        <Link className="leaderboardsLink" to="/">
          Leaderboards
        </Link>{" "}
        <Link className="marketplaceLink" to="/">
          Marketplace
        </Link>{" "}
        <Link className="faqsLink" to="/faqs">
          FAQs
        </Link>
      </nav></div>
      <Link className="loginLink" to="/login">
        <button id="loginLink">Log In</button>
      </Link>
    </div>
  );
};
export default NavBar;
